import { AddUser } from './AddUser';
import { TableUser } from './TableUser';
import axios from 'axios';
import { useState } from 'react';

export const UserList = () => {
	const [user, res] = useState('');
	axios({
		method: 'GET',
		url: 'https://60517468534609001767198c.mockapi.io/api/user',
		data: null,
	})
		.then((res) => {
			console.log(res);
			setUser(res.data);
		})
		.catch((err) => {
			console.log(err);
		});

	return (
		// const {user}= setUser()
		<div className='User-List'>
			<div className='Add-user'>
				<AddUser />
			</div>
			<div className='table-user table-wrapper'>
				<TableUser />
			</div>
		</div>
	);
};
